                        <div class="body__bottom">
                            Три года назад, глубокой ночью, я придумывал символ нашей компании, своего рода, подпись любого нашего интерьера. Ранее мы часто использовали матрешку, как элемент дизайна, создавая светильники или мебель похожей формы. Мне показалось, что у этой всей известной скульптуры не достаточно выражен характер и настроение. И я подумал: »а почему у нее нет ног и рук, почему эта скульптура настолько безлика, почему у нее нет головного убора, традиционного, например кокошника». Идея не заставила себя долго ждать и в ту же ночь я создал серию из четырех керамических скульптур различного характера, и расцветки. Я назвал эту скульптуру SHURA и в ней удалось совместить историю, современный дизайн и ироничные образы. Сегодня минуя различные перевоплощения, виды раскрасок и материалов, четыре с половиной метра расположена в ТЦ BROSKO MALL.                        </div>
